import style from "./SearchOptionPrice.module.css";

import SearchOptionUI from "../SearchOptionUI";

const searchItem = [
  "0 ~ $100",
  "$100 ~ $200",
  "$200 ~ $300",
  "$300 ~ $400",
  "$400 ~ $500",
];

const test = [
  { text: "0 ~ $100", value: 0 },
  { text: "yesterady", value: 1 },
  { text: "three days ago", value: 3 },
  { text: "a week ago", value: 7 },
  { text: "a month ago", value: 30 },
  { text: "three months ago", value: 90 },
  { text: "a year ago", value: 100 },
];

function SearchOptionPrice() {
  return <SearchOptionUI label="price" checkboxItem={searchItem} />;
}

export default SearchOptionPrice;
